import {getAllEvents,getDbList} from '../../actions/dataActions'

export default function Dashboard() {

    const dispatch=useDispatch()

    useEffect(() => {
        dispatch(getAllEvents())
        dispatch(getDbList())
    },[])

    return (
        <div className='dashboard'>
            <NavBar />
            <div className='body'>
                {/* <LeftSection /> */}
